			description: "We aim to show you accurate product information. Manufacturers, suppliers and others provide what you see here, and we have not verified it. Experience Lara Crofts defining moment as she becomes the Tomb Raider. In Shadow of the Tomb Raider, Lara must master a deadly jungle, overcome terrifying tombs, and persevere through her darkest hour. As she races to save the world from a Maya apocalypse, Lara will ultimately be forged into the Tomb Raider she is destined to be. Lara Croft has mastered an unforgiving jungle, explored vast landscapes filled with tombs, and battled Trinity for the fate of Humanity, all set against the backdrop of the Maya apocalypse. Yet even more adventures await in the hidden City of Paititi. New mysteries and challenges will arise, friendships and rivalries will deepen, and above all, new tombs will be discovered in a series of DLCs that expand the world of Shadow of the Tomb Raider. NOW ANNOUNCED: The first of seven new DLC adventures called The Forge will launch worldwide November 13th. Available as a free download to all Season Pass holders, or sold separately. In The Forge, Lara must brave the lava-flooded Forge of the fallen gods to uncover the secrets of Kuwaq Yaku. Throughout her journey, Lara will uncover details about a friends ancient legacy, and overcome a danger long thought to be lost in flame. The Forge delivers a brand-new challenge tomb, playable in both solo and co-op. Players who complete the challenge tomb will be rewarded with the Grenadier skill, Brocken outfit, and Umbrage 3-80 weapon. Survive and Thrive In the Deadliest Place on Earth: Master an unforgiving jungle setting in order to survive. Explore underwater environments filled with crevasses and deep tunnel systems. Become One With the Jungle: Outgunned and outnumbered, Lara must use the jungle to her advantage. Strike suddenly and disappear like a jaguar, use mud as camouflage, and instill fear in enemies to sow chaos. Discover Dark and Brutal Tombs: Tombs are more terrifying than ever before, requiring advanced traversal techniques to reach them, and once inside they are filled with deadly puzzles. Uncover Living History: Discover a hidden city and explore the biggest hub space ever found in a Tomb Raider game. Be sure to secure your Season Pass today! Available separately. Season Pass includes 7 Challenge Tombs, 7 weapons, outfits, and skills, and Multiple narrative side missions. Following a first Weapon/Outfit drop on Sept 14th, Season Pass content will release on a monthly basis.",
