			description: "We aim to show you accurate product information. Manufacturers, suppliers and others provide what you see here, and we have not verified it. Overwatch Legendary Edition Marketing Copy The world needs heroes. Join over 40 million players* as you take your place in the world of Overwatch. Choose your hero from a diverse cast of soldiers, scientists, adventurers, and oddities. Bend time, defy physics, and unleash an array of extraordinary powers and weapons. Engage your enemies in iconic locations from around the globe in the ultimate team-based shooter. Fight for the Future Experience the extraordinary Speed up and slow down time. Rain destruction from above in an experimental, jet-powered armor suit. Stalk your prey as a wraith-like assassin that can appear anywhere, anytime. Unleash powers like Dragonstrike, Transcendence, and Graviton Surge. Every hero has a unique set of extraordinary game-changing abilities. Play heroes, not classes Every hero has a unique perspective on the battlefield and a story behind how they arrived there. You are a champion of a bygone age wielding his punishing rocket hammer in the service of honor, a robotic monk committed to healing the rifts between man and machine, a genetically engineered gorilla who also happens to be a brilliant scientist, and many, many more. Fight for the futuretogether Teamwork is imperative for survival as you enter the fight with friends and comrades. Careful coordination will prove the difference between victory and defeat as your team combines the formidable powers at your disposal to devastating effect. Shift your perspective Just when it seems like your team is destined to go down in defeat, switch heroes on the fly and change the course of the battle. But dont forget that your opponents can do the same. Master the game within the game as both teams shift strategies and heroes in a constant dance to gain the upper hand. The world is your battlefield Protect the secrets of the mysterious Temple of Anubis in Egypt, safely escort an EMP device through Kings Row in London, and do battle at other key locations around the planet. Every map has its own distinct feel with unique gameplay and team-based objectives. ",
