			description: "We aim to show you accurate product information. Manufacturers, suppliers and others provide what you see here, and we have not verified it.Compact and lightweight, the whiteCanon EOS M100 Mirrorless Digital Cameramakes a suitable everyday companion for those who want both an easy-to-use and highly capable camera system.With built-in Wi-Fi, NFC, and Bluetooth, the 24.2MP APS-C camera makes it easy to share your snaps and videos almost immediately after you take them. For those looking to expand their photography skills this camera is a great stepping off point as it has a Creative Assist feature that can walk you through how certain settings affect your image. Or, if you simply want to capture your grand adventures with your friends, a Self Portrait mode is available for making use of the 180 tilt ability of the 3.0inch 1.04m-dot touchscreen LCD.Photographers who desire a compact and powerful camera will appreciate the performance of the M100 as it boasts a 24.2MP APS-C CMOS sensor and the DIGIC 7 processor to produce sharp, rich imagery at sensitivities up to ISO 25600. Shooters will also benefit from the Dual Pixel CMOS AF system to provide fast, accurate focusing while shooting both stills and video. Speed is also a highlight with continuous shooting at up to 4 fps with AF or up to 6.1 fps with AF lock. Beyond stills, the M100 has the ability to record high-quality video at up to 60 fps.Included with the camera body is the standard zoom EF-M 15-45mm f/3.5-6.3 IS STM lens, which provides a 24-72mm equivalent focal length range. The STM stepping motor delivers quick, quiet autofocus performance and the Optical Image Stabilizer compensates for 3.5 stops of camera shake for sharper handheld shooting. The lens' optical design also incorporates a trio of aspherical elements to control chromatic aberrations throughout the zoom range for sharper, clearer image quality.Further extending your reach, this kit also includes the EF-M 55-200mm f/4.5-6.3 IS STM lens, which offers an 88-320mm equivalent focal length range. This long-range zoom incorporates one aspherical element and one UD element to minimize aberrations and distortions and also features an Optical Image Stabilizer and STM stepping motor to benefit both stills and video applications.",
